import React, { useEffect, useRef, useState } from "react";
import "./ai-landing-step-two.css";
import clsx from "clsx";
import { useColorMode } from "@docusaurus/theme-common";
import { useTWBreakpoints } from "../hooks/use-tw-breakpoints";

const items = ["restapi", "graphql", "supabase", "nestjs", "strapi", "mock"];

export const AiLandingStepTwo = () => {
  const { colorMode } = useColorMode();
  const { sm, md, lg, xl } = useTWBreakpoints({ variant: "landing" });

  const [currentIndex, setCurrentIndex] = useState(0);
  const timerRef = useRef(null);

  const nextItem = () => {
    setCurrentIndex((prevIndex) => (prevIndex + 1) % items.length);
  };

  useEffect(() => {
    clearTimeout(timerRef.current);
    timerRef.current = setTimeout(() => {
      nextItem();
    }, 4000);

    return () => clearTimeout(timerRef.current);
  }, [currentIndex]);

  const handleClick = (index: number) => {
    setCurrentIndex(index);
  };

  const width = {
    xl: 588,
    lg: 436,
    md: 588,
    sm: 500,
    xs: 340,
  }[xl ? "xl" : lg ? "lg" : md ? "md" : sm ? "sm" : "xs"];

  return (
    <div
      className={clsx(
        "ai-landing-step-two-animation",
        "landing-lg:translate-x-8",
        "relative",
        "overflow-hidden",
        "flex-shrink-0",
        {
          light: colorMode === "light",
          dark: colorMode === "dark",
        },
      )}
      style={{
        width: `${width}px`,
        height: width === 344 ? "300px" : `${Math.floor(width * 0.83)}px`,
      }}
    >
      <div
        className={clsx(
          "absolute",
          "text-[#6c7793]",
          "text-xs landing-sm:text-base",
          "text-center",
          "z-[3]",
          "w-full",
          "top-[100px] landing-md:top-[60px] landing-lg:top-[104px]",
          "px-4",
          "whitespace-nowrap",
        )}
      >
        Which data provider do you want to use?
      </div>
      <GraphSvg
        activeItemName={items[currentIndex]}
        onClick={handleClick}
        width={width}
      />
    </div>
  );
};

